import React, { useState, useEffect } from "react";
import Department from "./Department";
import "./List.css";

function List(props) {
  // List has departments
  const endpoint = 'http://127.0.0.1:8000/data';
  const [departments, setDepartments] = useState(null);

  useEffect(() => {
    (async () => {
      const data = await fetch(endpoint).then(res => res.json())

      setDepartments(data);
    })()
  }, [])

  return (
    <div>
      {departments.data}
    {/* {departments ? <div className="list-component">
      {departments}
    </div> : 'Loading...'} */}
  </div>
  );
}

// Things get updated here

export default List;
